import React from "react";
import "./Hero.css";
import ContactButton from "../Button/ContactButton";

const Hero = () => (
  <section className="hero-section">
    <div className="hero-content">
      <h1>Katie Reed</h1>
      <p>Web Developer & Designer</p>
      <ContactButton label="CONTACT ME" />
    </div>
  </section>
);

export default Hero;
